arr a[20]
var n = 20

def fill() {
	var i = 0
	while ( i < n ) {
		a[i] = rand(100)
		i = i + 1
	}
}

def show() {
	var i = 0
	while ( i < n ) {
		print( a[i] )
		i = i + 1
	}
}

def sort() {
	var i = 0
	while ( i < n -1 ) {
		var j = 0
		while ( j < n - i - 1 ) {
			if ( a[j] > a[j+1] ) {
				var t = a[j]
				a[j] = a[j+1]
				a[j+1] = t
			}
			j = j + 1
		}
		i = i + 1
	}
}

def main() {
	fill()
	show()
	println()
	println()
	sort()
	show()
}

