def testEmptyDef() {}

def testDefWithArg( a ) {
	return a + 1
}

def testDefWithArgs( a, b ) {
	return a + b
}

def testDefWithReturnInMiddle() {
	print( 1 )
	return 0
	print( 2 )
}

def testDefWithNestedReturn() {
	var i = 0
	while ( i < 10 ) {
		if ( i > 5 ) { return i }
		i = i + 1
	}
}

def main() {
	var arg1 = 7
	var arg2 = 3

	testEmptyDef()
	print(testEmptyDef())
	println()

	testEmptyDef()
	print(testDefWithArg( 7 ))
	print(testDefWithArg( arg1 ))
	println()

	testEmptyDef()
	print(testDefWithArgs( 7, 3 ))
	print(testDefWithArgs( arg1, arg2 ))
	println()

	testDefWithReturnInMiddle()
	println()

	print(testDefWithNestedReturn())
	println()
}

def testIF( n ) {
	var i = 1
	while ( i <= n ) {
		if ( i % 3 == 0 ) {
			print( i )
		}
		i = i + 1
	}
}

def testIFnELIF( n ) {
	var i = 1
	while ( i <= n ) {
		var r = i % 3
		if ( r == 1 ) {
			print( i )
		} elif ( r == 2 ) {
			print( i )
		}
		i = i + 1
	}
}

def testIFnELSE( n ) {
	var i = 1
	while ( i <= n ) {
		var r = i % 3
		if ( r == 0 ) {
			print( 0 )
		} else {
			print( i )
		}
		i = i + 1
	}
}

def testIFnELIFnELSE( n ) {
	var i = 1
	while ( i <= n ) {
		var r = i % 3
		if ( r == 1 ) {
			print( 1 )
		} elif ( r == 2 ) {
			print( 2 )
		} else {
			print( 0 )
		}
		i = i + 1
	}
}

def testNestedIF( n ) {
	if ( n <= 10 ) {
		var i = 1
		while ( i <= n ) {
			var r = i % 3
			if ( r == 1 ) {
				print( 1 )
			} elif ( r == 2 ) {
				print( 2 )
			} else {
				print( 0 )
			}
			i = i + 1
		}
	} elif ( n <= 20 ) {
		var i = 11
		while ( i <= n ) {
			var r = i % 3
			if ( r == 1 ) {
				print( 1 )
			} elif ( r == 2 ) {
				print( 2 )
			} else {
				print( 0 )
			}
			i = i + 1
		}
	} else {
		var i = 21
		while ( i <= n ) {
			var r = i % 3
			if ( r == 1 ) {
				print( 1 )
			} elif ( r == 2 ) {
				print( 2 )
			} else {
				print( 0 )
			}
			i = i + 1
		}
	} 
}

