def testWhile( n ) {
	var i = 0
	while ( i < n ) {
		i = i + 1
		print(i)
	}
}

def testWhileWithBreak( n ) {
	var i = 0
	while ( i < n ) {
		i = i + 1
		if ( i == 5 ) { break }
		print(i)
	}
}

def testWhileWithContinue( n ) {
	var i = 0
	while ( i < n ) {
		i = i + 1
		if ( i == 5 ) { continue }
		print(i)
	}
}

def testNestedWhile( n ) {
	var i = 0
	while ( i < n ) {
		var j = 0
		while ( j < n ) {
			print( n * i + j + 1 )
			j = j + 1
		}
		println()
		i = i + 1
	}
}

def testNestedWhileWithBreak( n ) {
	var i = 0
	while ( i < n ) {
		if ( i == n - 1 ) { break }
		print( i )

		var j = 0
		while ( j < n ) {
			if ( j > i ) { break }
			print( j )
			j = j + 1
		}
		println()
		i = i + 1
	}
}

def testNestedWhileWithContinue( n ) {
	var i = 0
	while ( i < n ) {
		i = i + 1
		if ( i % 2 == 0 ) { continue }
		print( i )

		var j = 0
		while ( j < n ) {
			j = j + 1
			if ( j % 2 == 0 ) { continue }
			print( j )
		}
		println()
	}
}

def main() {
	testWhile( 10 )
	println()

	testWhileWithBreak( 10 )
	println()

	testWhileWithContinue( 10 )
	println()
	println()

	testNestedWhile( 5 )
	println()

	testNestedWhileWithBreak( 5 )
	println()

	testNestedWhileWithContinue( 5 )
	println()
}
